import React from "react";
import Task from "./Task";

export default function TaskList({ tasks, setTasks }) {
  return (
    <div className="taskListContainer">
      {tasks.map((task) => (
        <Task
          task={task}
          name={task.name}
          id={task.id}
          tasks={tasks}
          setTasks={setTasks}
        />
      ))}
    </div>
  );
}
